import React, { Fragment } from "react";
// import app from "./_app";

import Header from "../components/Header/Header";

function RootDir(props) {
  return (
    <Fragment>
      <Header path="/" />
      <div className="RootDir">
        <h1>This is my root dir!</h1>
      </div>
    </Fragment>
  );
}

export default RootDir;
